import { createRouter, createWebHistory } from 'vue-router';
const routes = [
  {
    path: '/',
    name: 'Home',
    component: () => import('../App.vue'),
}, ];
const router = createRouter({
history: createWebHistory(process.env.BASE_URL), routes,
});
export default router;
